import './App.css';
import Home from '../src/Pages/Home/home'
import { BrowserRouter as Router, Routes, Route, Navigate } from 'react-router-dom';

function App() {
  return (
    <div className="App">
      <Route path="/" element={<Navigate to="/sign-up" />} /> {/* Default redirect to sign-up */}
      <Home />
    </div>
  );
}

export default App;
